import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Auth from "./component/Auth/Auth";
import Home from "./component/Views/Home";
import UserProvider from "./component/Context/userProvider";
import FormTest from "./component/Views/FormTest";
import AuthLogin from "./component/Auth/AuthLogin";
import Detail from "./component/Views/Detail";

function App() {
    return (
        <UserProvider>
            <Router>
                <Switch>
                    <Route exact path="/" component={Home} />
                    <Route
                        path="/login"
                        render={(props) => (
                            <Auth {...props} authRender="login" />
                        )}
                    />
                    <Route
                        path="/signup"
                        render={(props) => (
                            <Auth {...props} authRender="signup" />
                        )}
                    />
                    <Route
                        path="/cart"
                        render={(props) => (
                            <AuthLogin {...props} componentView="cart" />
                        )}
                    />
                    <Route path="/product/:id" component={Detail} />
                    <Route path="/test" component={FormTest} />
                </Switch>
            </Router>
        </UserProvider>
    );
}

export default App;
